import React, { Fragment } from 'react';
import { useSpeachSynthesis } from 'react-speech-kit';
import Logo from './components/Image/Logo.png';

function FrontPage() {
    const Main_div = {
        width: '100%',
        height:'100vh',
        background:'#000',
        display:'grid',
        placeItems:'center'
      }
      const center_div = {
          width:'15rem',
          height:'15rem',
        //   background:'#eee',
          position:' relative'
      }
      const img = {
          width:'15rem',
          height:'10rem',
          position:' absolute',
          top:'50%',
          left:'50%',
          transform:'translate(-50% , -50%)'
      }
      const h1 = {
          color:'red',
          position: 'absolute',
          top:'70%',
          left:'auto'
      }
      const rotate = {
          width: '15rem',
          height:'15rem',
          borderRight:'0.3rem solid Green',
          borderRadius:'50%',
          position:'absolute'
      }
      const {speak} = useSpeachSynthesis("Welcome To murli construction")
    return (
        <Fragment>
            {/* {speak({text:'Welcome to murli construction'})} */}
            <div style={Main_div}>
                <div style={center_div}>
                    <div style={rotate} className="rotate"></div>
                    <img src={Logo} alt="" style={img} />
                </div>
                    <h1 style={h1}>Murli Construction</h1>
            </div>
        </Fragment>
    )
}

export default FrontPage;
